struct Object {
	byte _id;
	struct Rect {
		int16 _left, _top, _right, _bottom;
		void write(FILE *fp) {
			writeUint16LE(fp, _left);
			writeUint16LE(fp, _top);
			writeUint16LE(fp, _right);
			writeUint16LE(fp, _bottom);
		}
	};
	Rect _rect;
	Rect _actorRect;
	byte _actorOrientation;
	byte _enabled;

public:
	void write(FILE *fp) {
		writeByte(fp, _id);
		_rect.write(fp);
		_actorRect.write(fp);
		writeByte(fp, _actorOrientation);
		writeByte(fp, _enabled);
	}
};

